    const Img = <img src="./images/mish-mash-logo.png"/>
    return (
        <Navbar brand={Img} alignLinks="right" className="header">
            <NavItem href="/" className="white-text login valign-wrapper modal-trigger">
                Home
            </NavItem>
            <NavItem href="/allchefs" className="white-text signup valign-wrapper modal-trigger">
                Top Chefs
            </NavItem>
            <NavItem href="/categories" className="white-text fridge valign-wrapper">
                Fridge
            </NavItem>
            <NavItem href="/blogs" className="white-text fridge valign-wrapper">
                Blogs
            </NavItem>
            <NavItem href="" className="white-text fridge valign-wrapper">
                Signout
            </NavItem>
        </Navbar>
